import '../styles/globals.css'
import { motion, AnimatePresence } from "framer-motion"

export default function main ({ Component, pageProps, router }) {
  return (
  	<AnimatePresence>
  		<motion.div 
	  		key={router.route} 
	  		initial="pageInitial" 
	  		animate="pageAnimate" 

  			initial="hidden"
			animate="visible"
	  		exit="pageExit" 
	  		transition={{ default: { duration: 2 } }}
	  		variants={{
				pageInitial: {
					opacity: 0
				},
				pageAnimate: {
					opacity: 1
				},
				pageExit: {
					backgroundColor: 'white',
					opacity: 0
				}
			}}
		>
  			<Component {...pageProps} />
  		</motion.div>
  	</AnimatePresence>
  )
}
